import React from 'react'
import { FaShoppingCart } from "react-icons/fa";

export default function Header() {
  return (
    <header>
      <div>
        <span className="logo">House Staff</span>
      </div>

      <ul className="nav">
        <li>About</li>
        <li>Contact</li>
        <li>File</li>
		  </ul>
		  
		  

      <div className="presentation"></div>
    </header>
  );
}
